import React from "react";
import styled from "styled-components";

import { LayoutScreen } from "./layout.screen";
import { Button } from "../components/button.component";
import { DefaultNavContent } from "../components/default-nav-content.component";
import { DifficultyChooser } from "../components/difficulty-chooser.component";
import { Link } from "react-router-dom";

const Heading = styled.h1`
  text-align: center;
  color: white;
`;

const ButtonsContainer = styled.div`
  display: flex;
  flex-direction: column;
  width: 80%;
  margin: auto;
  padding: 1em;
  padding-bottom: 0;
  justify-content: center;
  border-radius: 7px;
  align-items: center;
  background-color: rgba(255, 255, 255, 0.6);
`;

export const DifficultyLevelScreenQuiz = () => {
  return (
    <LayoutScreen navbar={<DefaultNavContent />}>
      <Heading>Difficulty Level</Heading>

      <ButtonsContainer>
        <Link to="/quiz">Easy</Link>
        <Link to="/quiz-m">Medium</Link>
        <Link to="/quiz-h">Hard</Link>
      </ButtonsContainer>
    </LayoutScreen>
  );
};
